import React from 'react';
import UserPopup from '../components/user-popup'; 

// Dummy test data for UserProfileHeader
const testData = [
    {
        profilePictureBlob: 'blob1',
        name: 'User 1',
        userid: 'user1',
    },
    {
        profilePictureBlob: 'blob2',
        name: 'User 2',
        userid: 'user2',
    },
    // Add more test data rows as needed
];

export default function TestPage() {
    return (
        <div>
            {/* Render the UserPopup component with the test data */}
            <UserPopup title="User Profiles" data={testData} />
        </div>
    );
}
